const fetchHelper = async (url, options = {}) => {
    try {
      const response = await fetch(url, options);
  
      if (!response.ok) {
        return response.status; // 상태 코드 반환
      }
  
      return response;
    } catch (error) {
      console.error("네트워크 오류 발생!", error);
      return 500; // 네트워크 오류 시 500 반환
    }
  };
  
  export default fetchHelper;
